import React from "react";
import { Link } from "react-router-dom";

// import HomePage from './pages/Home';
// import BlogsPage from "../../pages/Blogs";
// import CategoriesPage from "../../pages/Categories";

export default function Navbar() {
    return (
      <nav class="navbar navbar-expand-lg bg-body-tertiary">
        <div class="container-fluid">
          <a class="navbar-brand" href="#">iX Software Engineering Blog</a>
          <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
          </button>
          <div class="collapse navbar-collapse" id="navbarSupportedContent">
            <ul class="navbar-nav me-auto mb-2 mb-lg-0">
              <li class="nav-item">
                <a class="nav-link active" aria-current="page" href="../../pages/Home/">Home</a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href="../../pages/Categories/" aria-current="page">
                  Categories
                </a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href="../../pages/Blogs">Blogs</a>
              </li>
              {/* <li class="nav-item">
                <a class="nav-link disabled" aria-disabled="true">Disabled</a>
              </li> */}
            </ul>
            <form class="d-flex" role="search">
              <input class="form-control me-2" type="search" placeholder="Search" aria-label="Search"></input>
              <button class="btn btn-outline-success" type="submit">Search</button>
            </form>
          </div>
        </div>
      </nav>
    );
}
